import React, { useState } from "react";
import clsx from "clsx";
export default function StepsInfo() {
  const [step, setStep] = useState(0);
  return (
    <div>
      <button
        onClick={() => {
          setStep((prev) => prev + 1);
        }}
      >
        next
      </button>
      <ul className="flex space-x-3">
        {[1, 2, 3, 4, 5].map((item, index) => {
          return (
            <li
              key={item}
              className={clsx("h-[10px] rounded-full border", {
                "w-[10px]": step != index,
                "w-[30px]": step == index,
                "border-neutrals-900": step < index,
                "border-primary-1 bg-primary-1": step >= index,
              })}
            ></li>
          );
        })}
      </ul>
    </div>
  );
}
